    private static readonly string FUN_STRING = ";;;;;9422abbb";
    private class NeuralNetwork
    {
        private float[] weights1, biases1;
        private float[] weights2, biases2;
        private float[] weights3, biases3;

        public NeuralNetwork(string wbHexString)
        {
            string[] wbArray = wbHexString.Split(';');
            weights1 = ConvertHexToFloatArray(wbArray[0]);
            biases1 = ConvertHexToFloatArray(wbArray[1]);
            weights2 = ConvertHexToFloatArray(wbArray[2]);
            biases2 = ConvertHexToFloatArray(wbArray[3]);
            weights3 = ConvertHexToFloatArray(wbArray[4]);
            biases3 = ConvertHexToFloatArray(wbArray[5]);
        }

        private float[] ConvertHexToFloatArray(string hexString)
        {
            float[] floats = new float[hexString.Length / 8];
            for (int i = 0; i < floats.Length; i++)
            {
                floats[i] = BitConverter.ToSingle(ConvertHexStringToByteArray(hexString.Substring(i * 8, 8)), 0);
            }
            return floats;
        }

        private byte[] ConvertHexStringToByteArray(string hexString)
        {
            byte[] bytes = new byte[hexString.Length / 2];
            for (int i = 0; i < bytes.Length; i++)
            {
                bytes[i] = Convert.ToByte(hexString.Substring(i * 2, 2), 16);
            }
            return bytes;
        }

        private float ReLU(float x)
        {
            return Math.Max(0, x);
        }

        private float Tanh(float x)
        {
            return (float)Math.Tanh(x);
        }

        private float DotProduct(float[] a, float[] b)
        {
            float sum = 0;
            for (int i = 0; i < a.Length; i++)
            {
                sum += a[i] * b[i];
            }
            return sum;
        }

        public float Forward(float[] input)
        {
            float[] layer1Output = new float[256];
            for (int i = 0; i < 256; i++)
            {
                layer1Output[i] = ReLU(DotProduct(input, SubArray(weights1, i * 776, 776)) + biases1[i]);
            }

            float[] layer2Output = new float[256];
            for (int i = 0; i < 256; i++)
            {
                layer2Output[i] = ReLU(DotProduct(layer1Output, SubArray(weights2, i * 256, 256)) + biases2[i]);
            }

            float output = Tanh(DotProduct(layer2Output, weights3) + biases3[0]);

            return output;
        }

        private float[] SubArray(float[] data, int index, int length)
        {
            float[] result = new float[length];
            Array.Copy(data, index, result, 0, length);
            return result;
        }
    }
